#include "Menu.h"

Menu::Menu()
	:
	_1v1Button((Graphics::ScreenWidth - 305) / 2, (Graphics::ScreenWidth - 305) / 2 + 305, 3*Graphics::ScreenHeight / 8, 3*Graphics::ScreenHeight / 8 + 52),
	AgainstBotButton((Graphics::ScreenWidth - 335) / 2, (Graphics::ScreenWidth - 335) / 2 + 335, _1v1Button.bottom + padding, _1v1Button.bottom + padding + 52)
{
}

void Menu::DrawMenu(Graphics& gfx)
{
	Draw1v1Button(gfx);
	DrawAgainstBotButton(gfx);
	DrawTitle(gfx);
}

Rec Menu::Get1v1ButtonRec()
{
	return _1v1Button;
}

Rec Menu::GetAgainstBotButtonRec()
{
	return AgainstBotButton;
}

